import styled from 'styled-components';

export const Container=styled.div`
    max-width: 1200px;
    margin: 0 auto;
`;
 export const Heading=styled.p`
  font-family: 'BerkeleyStd';
  margin: 0px;
  font-size: 42px;
  line-height: 1.14;
  letter-spacing: 0.5px;
  color: #022737;
  padding-bottom: 10px;
 `;
 export const Accountname=styled.p`
  font-family: BerkeleyStd;
  margin: 0px;
  font-weight: bold;
  font-size: 16px;
  line-height: 1.5;
  color: #022737;
 `;
 export const BalanceDate=styled.p`
 /* padding-bottom: 10px; */
  font-family: HelveticaNeue;
  margin: 0px;
  font-size: 16px;
  line-height: 1.5;
  color: #505050;
 `;
export const Notice=styled.div`
    background-color: #f2f2f2;
    margin-top: 20px;
    padding: 15px;
    border-radius: 0px;
    border-left: 4px solid #e37222 !important;
    border: none;
    margin-bottom: 35px;
`;
export const Content=styled.span`
    padding-left: 10px;
    font-family: HelveticaNeue;
`;
export const Wrapper=styled.div`
    background-color: #eaeaea;   
`;
export const Dashboard=styled(Container)`
     padding: 35px 0px; 
`;

export const ActivityContainer=styled.div`
    display: flex;
    flex-direction: row;
`;
export const AlignmentLeft=styled.div`
    flex-basis: 30%;
`;
export const AlignmentRight=styled.div`
    flex-basis: 70%;
    magin
`;

export const ButtonAlignment=styled.div`
    display: flex;
    justify-content: space-between;
`;
